import React from 'react'
import Data from "./CardData"
import SlideCards from "./slidecards"

function Slider() {
    return (
        <>
        {
            Data.map((val)=>{
                return (
                    <SlideCards link={val.link}
                                title = {val.title}
                                disc= {val.title}/>
                )
            })
        }
            
        </>
    )
}

export default Slider
